import React, { Component } from "react";
import ReactDOM from "react-dom";

// Images
import olinCounts from "./imgs/olinCounts.png";

// Components
import Calendar from "./Calendar";
import Counter from "./Counter";
import LatestCount from "./LatestCount";

function defaultDisplay() {
      ReactDOM.render(<LatestCount />, document.getElementById("mainContent"));
}
function newCountDisplay() {
      ReactDOM.render(<Counter />, document.getElementById("mainContent"));
      /*
      document.getElementById("mainContent").innerHTML = "";
      document.getElementById("mainContent").insertAdjacentHTML("beforeend", `${render}<Counter />`);
      */
}

class Home extends Component {
      render() {
            return (
                  <>
                        <div id="header">
                              <img src={olinCounts} id="mainLogo" alt="logo" />

                              <div id="headerRight">
                                    <div
                                          className="btn-group headerButtonGroup"
                                          role="group"
                                          aria-label="Basic example"
                                    >
                                          <button
                                                type="button"
                                                className="btn btn-primary headerButton"
                                                onClick={defaultDisplay}
                                          >
                                                Home
                                          </button>
                                          <button
                                                type="button"
                                                className="btn btn-primary headerButton"
                                          >
                                                Dashboard Mode
                                          </button>
                                          <button
                                                type="button"
                                                className="btn btn-primary headerButtonNewCount"
                                                id="newCount"
                                                onClick={newCountDisplay}
                                          >
                                                Start a new count{" "}
                                          </button>
                                    </div>
                              </div>
                        </div>
                        <div id="flexContainer1">
                              <div id="sidebar">
                                    <button
                                          type="button"
                                          className="btn btn-primary sideBarButton"
                                    >
                                          Student Login
                                    </button>
                                    <button
                                          type="button"
                                          className="btn btn-primary sideBarButton"
                                    >
                                          Admin Login{" "}
                                    </button>
                                    <button
                                          type="button"
                                          className="btn btn-primary sideBarButton"
                                    >
                                          Settings{" "}
                                    </button>
                                    <Calendar />
                              </div>

                              <div id="mainContent">
                                    <LatestCount />
                              </div>
                        </div>
                  </>
            );
      }
}

export default Home;
